import 'package:dio/dio.dart';
import 'package:flutter/material.dart';
import 'package:get/get.dart';
import 'package:schoolapp/screens/home.dart';

class LoginPage extends StatefulWidget {
  const LoginPage({super.key});
  
  @override
  State<LoginPage> createState() => _LoginPageState();
}

class _LoginPageState extends State<LoginPage> {
  final studentId = TextEditingController();
  final password = TextEditingController();

  void loginFunction(String studentId, String password) async{
        try{
          final response = await Dio().post('https://admin.schooldynamics.cloud/api/studentlogin', data: {'student_id':studentId, 'password':password});
          if(response.statusCode==200){
            Get.to(HomePage());
          }else{
            Get.snackbar("Error", response.data['message']);
          }
        }catch(error){
          print(error);
        }
      }

  @override
  Widget build(BuildContext context) {
    return GetMaterialApp(
      home: Scaffold(
        body: Padding(padding: EdgeInsetsGeometry.all(20),
          child: Column(
          children: [
            Row(
              mainAxisAlignment: MainAxisAlignment.center,
              children: [
                Image.network("data:image/webp;base64,", width: 150,),
              ],
            ),
            Row(
              mainAxisAlignment: MainAxisAlignment.center,
              children: [
                Text("MTA Secondary School", style: TextStyle(color: Colors.red, fontSize: 28, fontWeight: FontWeight.w800),),
              ],
            ),
            Text("Forward ever"),
            SizedBox(height: 10,),
            Text("Login to continue"),
            SizedBox(height: 10,),
            Row(
              children: [
                Expanded(
                  child: TextField(
                    controller: studentId,
                    decoration: InputDecoration(
                      hintText: "Student Id",
                    ),
                  ) 
                ),  
              ],
            ),
            Row(
              children: [
                Expanded(
                  child: TextField(
                    controller: password,
                    decoration: InputDecoration(
                      hintText: "Password",
                    ),
                    obscureText: true,
                  ),
                ),
              ],
            ),
            Row(
              mainAxisAlignment: MainAxisAlignment.center,
              children: [
                Padding(padding: EdgeInsetsGeometry.directional(top: 10),
                  child: TextButton(
                    style: ButtonStyle(),
                    onPressed: (){
                      loginFunction(studentId.text,password.text);
                    }, 
                    child: Text("Login"),
                    )
                ),
              ],
            ),
          ],
        ),
        ),
      ),
    );
    
  }
}